import CardList from './CardList';
import SearchBox from'./SearchBox';
import {robots} from './robots.js';



class App extends Component {

	constructor ()
	{
		super()
	}

	render() {
		return (
				<div>
				 <h1 className="tc">RoboFriend</h1>
				 <SearchBox />
				 <CardList robots={robots}/>
				</div>
		);
	}

}

export default App ;
